import React from 'react';
import Overview from './Overview';
import ActivityList from './ActivityList';
import generateRandomActivities from './generateRandomActivities'; // Import the function

const Dashboard = () => {
  // Generate a random list of activities, let's say 10 for this example
  // Hardcoded list of activities
  const activities = [
    { id: 1, name: 'Ashley Lopez', phone: '(212) 555-8263', email: 'ashley@example.com', amount: 200 },
  ]

  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      <Overview />
      <ActivityList activities={activities} /> {/* Pass the random activities to the ActivityList */}
    </div>
  );
};

export default Dashboard;
